import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Navbar from './Navbar';  // Import the Navbar component
import HomePage from './HomePage';  // Import the HomePage component
import AboutPage from './AboutPage';  // You can create this for About Me
import ProjectsPage from './ProjectsPage';  // You can create this for Projects
import CertificationsPage from './CertificationsPage';  // You can create this for Certifications
import ContactPage from './ContactPage';  // You can create this for Contact
import './App.css';

function App() {
  return (
    <Router>
      <div className="App">
        <Navbar />
        <div className="content">
          <Switch>
            {/* Define routes here */}
            <Route exact path="/" component={HomePage} />
            <Route path="/about-me" component={AboutPage} />
            <Route path="/projects" component={ProjectsPage} />
            <Route path="/certifications" component={CertificationsPage} />
            <Route path="/contact" component={ContactPage} />
          </Switch>
        </div>
      </div>
    </Router>
  );
}

export default App;
